import React from "react";
import Card from "@mui/material/Card";
import Box from "@mui/material/Box";
import Icon from "@mui/material/Icon";
import TextField from "@mui/material/TextField";
import Typography from "@mui/material/Typography";
import AccountCircleIcon from "@mui/icons-material/AccountCircle";
import RefreshIcon from "@mui/icons-material/Refresh";

const Infleta = () => {
  return (
    <Card>
      <Box display="flex" justifyContent="space-between" alignItems="center" p={3}>
        <Box>
          <Typography variant="h6" gutterBottom>
            ¿Cuotas o Contado?
          </Typography>
          <Box display="flex" alignItems="center" lineHeight={0}>
            <Icon
              sx={{
                fontWeight: "bold",
                color: (theme) => theme.palette.info.main,
                mt: -0.5,
              }}
              fontSize="large"
            >
              price_change
            </Icon>
            <Typography variant="button" fontWeight="regular" color="text.primary">
              &nbsp;<strong> Mejora tu estrategia de pagos: </strong>
              calcula si te conviene cuotas o pago único.
            </Typography>
          </Box>
        </Box>
        <Box color="text.primary" px={2}>
          <Icon sx={{ cursor: "pointer", fontWeight: "bold" }} fontSize="small">
            <RefreshIcon />
          </Icon>
        </Box>
      </Box>

      <Box component="form" role="form" p={3}>
        <Box>
          <TextField id="filled-basic" label="Filled" variant="filled" />
        </Box>
      </Box>
    </Card>
  );
};

export default Infleta;
